(91, 'Sarah', 'Marrs', NULL, NULL, 0, '{en}', FALSE, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1760734818, NULL, NULL, 'approved', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sarah Marrs', '8 years of experience as a Registered Dietitian', 'Arizona State University, MS, Human Nutrition, 2018; Michigan State University, Dietetic Internship, Community Nutrition, 2012; Madonna University, BS, Nutrition, 2011', 'Sarah is a Registered Dietitian/Nutritionist based in northern Vermont who is passionate about helping people make sustainable behavior changes to improve their health, break free from dieting, and develop a healthy relationship with food. In her eight years as a dietitian, she’s worked with all different populations and age groups and in both clinical and outpatient settings; she currently works with clients part-time in her own private practice. She believes building strong and trusting relationships with her clients is key to helping them reach their goals and prides herself in her ability to make healthy eating and behavior change less complicated and stressful for her clients.', 'There is definitely no "one size fits all" when it comes to health. Health means different things to each person, so I help clients pinpoint what "health" means to them and then I help them make sustainable changes to their diet and lifestyle to help get them there. I don’t believe in "good" or "bad" foods, and believe that food is more than just fuel. Food is meant to be enjoyed, not stressed over or feared, and I want clients to know that they don’t have to choose between health and enjoyment when it comes to eating. I take a more weight-neutral approach to my counseling, meaning that I will respect and honor someone’s goal to lose weight, but will always focus my counseling on behavior change because health is not determined by the number on the scale. It’s my mission to help you reconnect with your internal body cues, break free from diet rules (for good!), make peace with food and your body, and live a life of food freedom.', 'Hiking, snowboarding, baking, cooking, strength training', 'Cinnamon Rolls, anything chocolate and peanut butter, nachos', 'MS, RDN', 'Intuitive Eating, Eating Disorders/Disordered Eating, Wellness', '{4}', NULL, NULL, NULL, NULL, NULL),
(88, 'Kenya', 'Powell', NULL, NULL, 0, '{en}', FALSE, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1154780856, NULL, NULL, 'approved', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Kenya Powell', '13 years of experience as a Registered Dietitian in Community Health and 5 years as a Clinical Dietitian.', 'Winthrop University, BS, Human Nutrition, 1999. South Carolina Department of Health and Environmental Control, Dietetic Internship, 2001', 'Kenya is a South Carolina-based Registered Dietitian who is passionate about promoting disease prevention, disease management, and healthy food availability to improve healthy food choices. She has worked in both the community and clinical settings. She has 13 years of experience in nutrition counseling and providing healthy nutrition information to promote healthy behavioral changes to low income communities. She has worked in an acute care hospital and a rehabilitation hospital for over 7 years as a clinical dietitian.', 'I believe in client-centered counseling. I believe in meeting the individual where they are now in their nutrition habits, and then building from there, in order to meet their nutrition related goals. By doing so, individuals will be able to meet their goal successfully. I believe that by giving the right tools, strategies, and information to make positive changes in their lifestyles and eating habits, my patients can reach and maintain their nutrition and health goals successfully.', 'Fishing and reading', 'Spinach, broccoli, catfish, salmon, white and sweet potatoes', 'RD, LD', 'Chronic Disease management and Pediatrics ages infant-children 1-5 years', '{1,2,5}', NULL, NULL, NULL, NULL, NULL),
(57, 'Lindsey', 'Repine', NULL, NULL, 0, '{en}', FALSE, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1811501380, NULL, NULL, 'approved', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Lindsey Repine', '13 years of experience as a Registered Dietitian', 'Stony Brook University, MS, Health Care Policy and Management, 2008\\nStony Brook University, Dietetic Internship, Clinical Nutrition, 2008\\nThe Pennsylvania State University, BS, Nutritional Sciences, 2007', 'Lindsey is a Pittsburgh-based Registered Dietitian who is passionate about helping people find health through nutrition. She has over 10 years of experience in both inpatient and outpatient clinical settings which has allowed her to treat a wide range of disease states.', 'I believe in empowering my clients to make a healthy lifestyle change. This is not a one-size-fits-all approach; I will work side by side with my clients to develop a plan that is sustainable and long-lasting. My ultimate goal is to promote wellness and a healthy relationship with food. Diet is a noun, not a verb!', 'Travel, yoga, interior design, reading', 'Pasta, chocolate, and blueberries', 'MS, RD, LDN', 'Weight management, chronic disease', '{0,1}', NULL, NULL, NULL, NULL, NULL),
(127, 'Miriam', 'Christie', NULL, NULL, 0, '{en}', FALSE, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1447496070, NULL, NULL, 'approved', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Miriam Christie', '23 years of experience as a Registered Dietitian', 'University of California Davis (1996) Graduate Degree, Nutrition Molecular Biology\\nUniversity of California Davis (1992) Graduate Degree, Nutrition Immunology\\nUniversity of Guelph (1990) Undergraduate Degree, Biochemical Nutrition', 'As a Registered Dietitian, Miriam is focused on promoting health and wellness. She has worked extensively in the field of nutrition research and education, teaching and developing nutrition education courses for various educational/interest levels. As a dietitian, Miriam has had the experience of working in a variety of settings, and has directed her focus to Adult, Geriatric and pediatric populations in both the Home and Hospice settings.\\nThrough her Consulting services, she provides nutrition education and/or exercise consultations to help her clients lead a higher quality of life. Her sessions are tailored to meet the needs of the client, and include a variety of populations including: general health and wellness, weight loss, renal disease, cardiovascular disease, diabetes and cancer, GI disorders, eating disorders (anorexia, bulimia), and weight management.', 'I am a huge proponent of “healthy eating” as opposed to conventional dieting as the best way to reach your desired weight and nutrition goals. Balance, variety, and moderation is the focus of sustainable nutrition.  MY goal is to help you reach YOUR goal. The word eliminate is not a part of my vocabulary.  My approach to helping you reach your nutrition goal is to help develop a plan that will be a part of your healthy lifestyle for the rest of your life.', 'Hiking, Swimming, Baseball', 'Yogurt parfait', 'MS, RD, LD, ABD', 'Weight Management, Diabetes, Chronic Disease, Pediatrics\\nBariatric Medicine, Cardiac Nutrition, Diabetes and Pre Diabetes Nutrition, Renal, Gastrointestinal Issues, General Wellness, Gerontological Nutrition, Oncology Nutrition- Cancer Prevention, Oncology Nutrition- Cancer Treatment Management, Postpartum Nutrition,Prenatal Nutrition, Preventive Medicine, Corporate Wellness', '{0,1,2,4,5}', NULL, NULL, NULL, NULL, NULL),
