(108, 'Jennifer', 'Holden', NULL, NULL, 0, '{en}', FALSE, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1992124770, NULL, NULL, 'approved', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jennifer Holden', '9 years of experience as a Registered Dietitian', 'Viterbo University, BS, Nutrition and Community Medical Dietetics, 2012', 'Jennifer is a midwestern dietitian who is passionate about helping others make eating healthy, simple and fun.  She has worked as a grocery store dietitian for over seven years, guiding customers while they shop, providing nutrition education for disease states and helping busy families get healthy meals on the table in an affordable and enjoyable way.', 'I’m not a fan of diets, but creating healthy lifestyles that allow all foods in. I will work with you to figure out how to develop a positive relationship with food and balance your favorite things with healthy eating habits and exercise.', 'I enjoy hiking, gardening, cooking, crafts, but most of all playing with my kids', 'There are few foods I don’t love, however, I am a big fan of dark chocolate', 'RD', 'Weight Management, Corporate Wellness, Chronic Disease', '{0,2}', NULL, NULL, NULL, NULL, NULL),
(104, 'Courtney', 'Schand', NULL, NULL, 0, '{en}', FALSE, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1114567567, NULL, NULL, 'approved', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Courtney Schand', '7 years of experience as a Registered Dietitian', 'The University of Tennessee, MS, Public Health Nutrition 2013; Tennessee Technological University, BS, Human Ecology, 2011', 'Courtney is a Tennessee native. Having studied human development for 13+ years professionally, she knows what it takes for humans to thrive. She worked as a Clinical Wellness Dietitian, coaching people to long term, actionable changes that are in line with their goals and values for 6+ years and is passionate about healthy relationships. She understands the interdependence of a person’s ecosystem (the people in their lives, their habits, and their environment), and their health outcomes which lead to lasting impacts that can be acheived when we view ourselves in an ongoing relationship to our health and the people around us.', 'I believe what we eat is only one part of the puzzle when it comes to managing health. Since we are multi-faceted, as humans, our preferences, experiences and goals need to be at the forefront of building a lifestyle change that will be sustainable. Your nutrition doesn’t have to be "perfect" to create sizeable changes as long as it’s a good fit for you. I bring a lens of intuitive eating to help clients have a healthy relationship with food while they create the results they desire.', 'Gardening, cooking, walking, refinishing furniture, flowers', 'Nachos', 'MS, RDN, LDN', 'Wellness coaching, weight management, eating disorders', '{0,2,4}', NULL, NULL, NULL, NULL, NULL),
