-- Mappings for providers and departments.
DO $$
DECLARE
    iterations INT := 500;
    i INT;
BEGIN
    FOR i IN 0..(iterations - 1) LOOP
        SELECT d.department_id, p.provider_id
        FROM 
            (SELECT department_id FROM telenutrition.schedule_department ORDER BY RANDOM() LIMIT 1) d,
            (SELECT provider_id FROM telenutrition.schedule_provider ORDER BY RANDOM() LIMIT 1) p
        WHERE d.department_id IS NOT NULL AND p.provider_id IS NOT NULL
        ON CONFLICT do nothing;
    END LOOP;
END $$;

-- Random appointment generation with extra rows for frozen records and other variations
-- select * from telenutrition.schedule_appointment
DO $$
DECLARE
    base_date DATE := CURRENT_DATE;
    num_days INT := 90;
    start_times TEXT[] := ARRAY['08:00','09:30','10:00','10:30','11:00','11:30','12:00','12:30','13:30','14:00','16:00','16:30','17:00','18:30'];
	department_ids INT[];
    dept_id INT;
    i INT;
BEGIN
    SELECT ARRAY(SELECT DISTINCT department_id FROM telenutrition.schedule_department_provider) INTO department_ids;

    FOR i IN 0..(num_days - 1) LOOP
		dept_id := department_ids[i % array_length(department_ids, 1) + 1];
	
	END LOOP;
END $$;
